import React from 'react'
import './step4.scss'

export default function Step4({ nextStep, prevStep }) {
  return (
    <div className="step4">
      <h2>Podstawowe dane nieruchomości</h2>
      <input type="number" placeholder="Powierzchnia" />
      <input type="number" placeholder="Wysokość" />
      <input type="number" placeholder="Liczba ścian zewnętrznych" />
      <button onClick={prevStep}>Wstecz</button>
      <button onClick={nextStep}>Dalej</button>
    </div>
  );
}
